import * as ActionTypes from "../actions/authActions";
import axios from "axios";
export const authStart = authData => {
  return {
    type: ActionTypes.AUTH_START
  };
};
export const authSuccess = authData => {
  return {
    type: ActionTypes.AUTH_SUCCESS,
    authData: authData
  };
};
export const authFail = error => {
  return {
    type: ActionTypes.AUTH_FAIL,
    error: error
  };
};
export const userActions = {
  auth
};

function auth(email, password) {
  const config = {
    url:
      "https://agentui.asista.in/Oauth/rest/client/auth?domain=agentui.asista.in",
    method: "POST",
    headers: {
      "Content-Type": "application/json",
      "device-type": "web"
    }
  };
  const credentials = {
    username: email,
    password: password
  };
  return dispatch => {
    dispatch(authSuccess(email, password));
    axios(config, credentials);
  };
}
